import React from "react";

import Header from "./components/Header/Header";

import "./App.css";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element></Route>
      </Routes>
    </div>
  );
}

export default App;
